query GetExecution($execution_id: String!, $query_id: Int!, $parameters: [Parameter!]!) {
  get_execution(
    execution_id: $execution_id
    query_id: $query_id
    parameters: $parameters
  ) {
    execution_queued {
      execution_id
      execution_user_id
      position
      execution_type
      created_at
      __typename
    }
    execution_running {
      execution_id
      execution_user_id
      execution_type
      started_at
      created_at
      __typename
    }
    execution_succeeded {
      execution_id
      runtime_seconds
      generated_at
      columns
      data
      max_result_size_reached_bytes
      request_max_result_size_bytes
      __typename
    }
    execution_failed {
      execution_id
      type
      message
      metadata {
        line
        column
        hint
        __typename
      }
      runtime_seconds
      generated_at
      __typename
    }
    __typename
  }
}
